import React from 'react'
import Layout from './Hoc/Layout'
import { Switch, Route } from 'react-router-dom'

import Home from './Components/home'

const Routes = (props) => {
  return(
    <Layout>
        <Switch>
          <Route> <Home/> </Route>
        </Switch>
    </Layout>
  )
}

export default Routes;
